drop DATABASE if exists atendimento;
CREATE DATABASE `atendimento`;


USE `atendimento`;

set global time_zone = "-03:00";

DROP TABLE IF EXISTS `atendimento`.`estado` ;

CREATE TABLE IF NOT EXISTS `atendimento`.`estado` (
  `id` INT NOT NULL auto_increment,
  `nome` VARCHAR(50) NOT NULL,
  `sigla` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;


-- -----------------------------------------------------
-- Table `atendimento`.`cidade`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `atendimento`.`cidade` ;

CREATE TABLE IF NOT EXISTS `atendimento`.`cidade` (
  `id` INT NOT NULL auto_increment,
  `nome` VARCHAR(255) NOT NULL,
  `estado_id` INT NOT NULL,
  PRIMARY KEY (`id`),
  INDEX `fk_cidade_estado1_idx` (`estado_id` ASC),
  CONSTRAINT `fk_cidade_estado1`
    FOREIGN KEY (`estado_id`)
    REFERENCES `atendimento`.`estado` (`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

