create table `cliente` (
  `id` int(11) NOT NULL,
  `nome` varchar(80),
  `nomefantasia` varchar(60),
  `cidader` varchar(40),
  `ufr` varchar(2),
  `grupo` int(11),
  `foneresidencial` varchar(20),
  `fonemovel` varchar(20),
  `fax` varchar(20),
  `fonecontato` varchar(20),
  `vendedor` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  FOREIGN KEY (`grupo`)
  REFERENCES `atendimento`.`grupo` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


create table `chamado` (
  `id` int(11) NOT NULL auto_increment,
  `data_preenchimento` datetime NOT NULL,
  `data_recebimento` date NOT NULL,
  `data_envio` date NOT NULL,
  `observacao` varchar(240),
  `status` enum("PENDENTE","REALIZADO"),
  `telefone` varchar(20) NOT NULL,
  `telefone_opt` varchar(20),
  `email` varchar(50),
  `nome_cliente` varchar(100) NOT NULL, #no caso de ser prospecção,  o nome do cliente vai ser inserido
  `nome_consultor` varchar(50) NOT NULL,
  `vendedor_id` int(11) NOT NULL, 
  `usuario_id` int(11) NOT NULL,
  `cidade_id` int(11),
  `cliente_id` int(11),#se for cliente antigo, vai ser inserido o código
  PRIMARY KEY (`id`),
  FOREIGN KEY (`vendedor_id`)
  REFERENCES `atendimento`.`vendedor` (`id`),
  FOREIGN KEY (`usuario_id`)
  REFERENCES `atendimento`.`usuario` (`id`),
  FOREIGN KEY (`cliente_id`)
  REFERENCES `atendimento`.`cliente` (`id`),
    FOREIGN KEY (`cidade_id`)
  REFERENCES `atendimento`.`cidade` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

create table `prospeccao` (
  `id` int(11) NOT NULL auto_increment,
  `data_preenchimento` datetime NOT NULL,
  `data_recebimento` date NOT NULL,
  `observacao` varchar(240),
  `status` enum("PROSPECTO","CONTATO","PROPOSTA","ANALISE","FINALIZADO"),
  `produto` enum("NETSPEED","GÁLAGO"),
  `telefone` varchar(20) NOT NULL,
  `telefone_opt` varchar(20),
  `email` varchar(50),
  `nome_cliente` varchar(100) NOT NULL, #no caso de ser prospecção,  o nome do cliente vai ser inserido
  `nome_consultor` varchar(50) NOT NULL,
  `vendedor_id` int(11) NOT NULL, 
  `cidade_id` int(11),
  `cliente_id` int(11),#se for cliente antigo, vai ser inserido o código
  PRIMARY KEY (`id`),
  FOREIGN KEY (`vendedor_id`)
  REFERENCES `atendimento`.`vendedor` (`id`),
  FOREIGN KEY (`cliente_id`)
  REFERENCES `atendimento`.`cliente` (`id`),
    FOREIGN KEY (`cidade_id`)
  REFERENCES `atendimento`.`cidade` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

